window.bookSummaryJSON = "<p><b>Amor est finis.</b></p> <p><b>Love is the ending.</b></p> <p><b>The Crow</b></p> <p>The Obsidian Order demands not just survival but submission.</p> <p>Every trial, every secret unearthed, binds me deeper to this clandestine world where power is currency and loyalty is conditional.</p> <p>Yet beneath the surface, a rebellion simmers within me.</p> <p>And Delilah, my obsession, my bride, is the reason.</p> <p>I vowed to protect her, to fight for her.</p> <p>But can I defy the very Order that shaped me?</p> <p>For my little raptor, I'd take on the world.</p> <p>Because she is everything.</p> <p><b>The Raptor</b></p> <p>Freedom was once a simple dream.</p> <p>Now it's complicated by the web of intrigue and danger spun around me.</p> <p>Finding Ben was supposed to answer questions, not multiply them.</p> <p>Not only within reality but within myself.</p> <p>Xavier, the man whose name is synonymous with both violence and death, has become my protector.</p> <p>Bound by my contract, we navigate this dark labyrinth together,</p> <p>except the Bride Hunt was just the beginning.</p> <p>Now, we must fight not just for our love, but for our very lives.</p> <p>Vicious Society <i>is book two in The Obsidian Order Duet and completes the story. It contains a stabby FMC and a morally gray hero that's OTT/JP, a stalker who falls first, has Touch Her &amp; Die energy, and is willing to do whatever it takes to keep her.</i></p> <p><i>Contains mature content. A complete list of content warnings can be found on the author's website. Narrated in duet style.</i></p>"; 
